import React from "react";
import { Link } from "react-router-dom";

function GeneralHeader(){
    return (
        <header>
            <Link to='/'>Главная</Link>
            <Link to="/login">
                <button> Вход </button>
            </Link>
            <Link to="/registration">
                <button>Регистрация </button>
            </Link>
        </header>
    );
}

export default GeneralHeader;
